using namespace std;

typedef long long LL;
typedef long double LD;
typedef pair<int, int> PII;

class Solution {
public:
	vector<int> findAnagrams(string s, string p) {
		map<char, int> mci;
		for (int i = 0; i < p.size(); i++) {
			mci[p[i]]++;
		}

		int st = 0, ed = 0;
		vector<int> vi;
		map<char, int> tab = mci;
		int cnt = mci.size();

		while (st < s.size()) {
			while (ed < s.size() && ed - st < p.size()) {
				tab[s[ed]]--;
				if (mci.count(s[ed]) && tab[s[ed]] == 0) {
					cnt--;
				}
				ed++;
			}
			if (cnt == 0) {
				vi.push_back(st);
			}

			if (mci.count(s[st]) && tab[s[st]] == 0) {
				cnt++;
			}
			tab[s[st++]]++;
		}//while
		return vi;
	}
};

string s1 = "";
string s2 = "";

int main()
{
	freopen("in.txt", "r", stdin);
	freopen("out.txt", "w", stdout);
	ios::sync_with_stdio(false);
	cin.tie(0); cout.tie(0);

	Solution sol;
	
	sol.findAnagrams(s1, s2);



	return 0;
}